import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { Button } from '@mui/material';
import '@fontsource/roboto/300.css';
import '@fontsource/roboto/400.css';
import '@fontsource/roboto/500.css';
import '@fontsource/roboto/700.css';
import { withStyles } from "@material-ui/core/styles";
import computer from '../images/computer.png'

const WhiteTextTypography = withStyles({
    root: {
        color: "#FFFFFF"
    }
})(Typography);

export default function IntroBox() {

    return (
        <>
            <Box sx={{ mt: 25, textAlign: 'left', float: 'left', pr: 20}}>
                <WhiteTextTypography variant="h3" sx={{ mb: 2.5 }}>
                    Hello world, it's Hailey,
                </WhiteTextTypography>
                <WhiteTextTypography variant="h5">
                    A fullstack software developer
                </WhiteTextTypography>
                <Button variant="contained" sx={{ mt: 5, backgroundColor: '#C968AC' }}>
                    <svg style={{marginRight: 10}} stroke="currentColor" fill="none" stroke-width="2" viewBox="0 0 24 24" stroke-linecap="round" stroke-linejoin="round" class="mr-2 sm:mr-3 h-5 w-5 sn:w-6 sm:h-6 duration-100" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg">
                        <circle cx="12" cy="12" r="10"></circle>
                        <polyline points="8 12 12 16 16 12"></polyline>
                        <line x1="12" y1="8" x2="12" y2="16"></line>
                    </svg>
                    Download Resume
                </Button>

            </Box>
            <Box sx={{ mt: 25, textAlign: 'right', float: 'right' }}>
                <img src={computer} alt='computer' />
            </Box>
        </>
    )
}
